<html>
<script language="javascript" type="text/javascript">

//지도에서 역(동그라미)를 클릭하면 출경도 버튼 띄우는 함수
function on_click(evt)
{
	//변수 연결
	var circle = evt.target;

	var name = circle.getAttribute('value');
	android.send(name);

	var pin = document.getElementById( 'pin' );
	var pin_sh = document.getElementById( 'pin_sh' );

	//get
	var name = circle.getAttribute('value');
	var x = circle.getAttribute('cx');
	var y = circle.getAttribute('cy');


	//opacity
	pin.setAttribute('opacity', 100 );
	pin_sh.setAttribute('opacity', 100 );


	//x좌표
	pin.setAttribute("x", x-45);
	pin_sh.setAttribute("x", x-42);


	//y좌표
	pin.setAttribute("y", y-95);
	pin_sh.setAttribute("y", y-92);


}


//자동입력 전달
function setMessage(arg)
{
		//변수 array_station 는 문서 객체를 가지는 배열로 들어 간다.
		var array_station = document.getElementsByName("station");

        for(var i=0; i<array_station.length;i++){
        	if(arg == array_station[i].getAttribute('value')){


        		on_click3(array_station[i].getAttribute('id'));
        	}
        }
}


//자동입력에서 넘어오는 함수
function on_click3(evt)
{
	//변수 연결
	var circle = document.getElementById( evt );

	var name = circle.getAttribute('value');
	android.send(name);


	var pin = document.getElementById( 'pin' );
	var pin_sh = document.getElementById( 'pin_sh' );


	//get
	var name = circle.getAttribute('value');
	var x = circle.getAttribute('cx');
	var y = circle.getAttribute('cy');


	//opacity
	 pin.setAttribute('opacity', 100 );
	 pin_sh.setAttribute('opacity', 100 );


	//x좌표
	 pin.setAttribute("x", x-45);
	 pin_sh.setAttribute("x", x-42);


	//y좌표
	 pin.setAttribute("y", y-95);
	 pin_sh.setAttribute("y", y-92);

}


</script>
